        return (0, latestAnswer, 0, block.timestamp, 0);
    }

    function latestRoundData() external view override returns (
        uint80, int256, uint256, uint256, uint80
    ) {
        return (0, latestAnswer, 0, block.timestamp, 0);
    }

    function setPrice(int256 _price) external {
        latestAnswer = _price;
    }
}

